// interface IContentList {
//     data: {
//         main: {
//             temp: number,
//             feels_like: number,
//             humidity: number,
//             pressure: number,
//         },
//         wind: {
//             speed: number,
//         },
//         visibility: number,
//         name: string,
//         sys: {
//             country: string
//         },
//         weather: [],
//     }
// }

import { IData } from "../Weather";

export function ContentList({data}: IData) {
    return (
        <ul className='content__list'>
            <li className="content__item">
                <span className='content__title content__temp'>Temperature:</span>
                <span className='content__value'>{Math.trunc(data.main.temp)}</span>
                <span>℃</span>
            </li>
            <li className="content__item">
                <span className='content__title content__feels'>Feels like:</span>
                <span className='content__value'>{Math.trunc(data.main.feels_like)}</span>
                <span>℃</span>
            </li>
            <li className="content__item">
                <span className='content__title content__wind'>Wind speed:</span>
                <span className='content__value'>{data.wind.speed}</span>
                <span>m/sec</span>
            </li>
            <li className="content__item">
                <span className='content__title content__humidity'>Humidity:</span>
                <span className='content__value'>{data.main.humidity}</span>
                <span>%</span>
            </li>
            <li className="content__item">
                <span className='content__title content__pressure'>Pressure:</span>
                <span className='content__value'>{data.main.pressure}</span>
                <span>hPa</span>
            </li>
            <li className="content__item">
                <span className='content__title content__pressure'>Visibility:</span>
                <span className='content__value'>{data.visibility}</span>
                <span>m</span>
            </li>
        </ul>
    )
}
